  summary: >-
    Validates the parameters passed to the compound command.

    Ensures the number of parameters and their content are correct.
  remarks: >-
    The compound command should receive exactly one parameter, which must contain a valid end marker

    such as "endif", "endwhile", "endfor", or "endmethod". If these conditions are not met, an exception is thrown.
